export function getDataSetEntities() {
  return new Promise((resolve, reject) => {
    setTimeout(() => {
      resolve({
        items: [
          {
            name: "Account",
            logicalName: "account",
            label: "Organizations",
            fields: [
              {
                value: "idContact",
                label: "idContact",
                type: "field",
                valueType: "boolean",
                chosen: true,
              },
              {
                value: "nameContact",
                label: "contactName",
                type: "field",
                valueType: "date",
                chosen: true,
              },
              {
                value: "account",
                label: "Account",
                type: "related",
                chosen: false,
              },
              {
                value: "activity_mime_attachment",
                label: "Attachments",
                type: "related",
                chosen: false,
              },
            ],
          },
          {
            name: "Activity_Mime_Attachment",
            logicalName: "activity_mime_attachment",
            label: "Attachments",
          },
        ],
      });
    }, 500);
  });
}
